  constructor (props) {
    super (props); 

    this.state = {
      cardId : [1,2,3,4,5], 
      cardState : 0
    }
  }

  render () {
    return (
      <div className="className">
          <table>
              <Card /> 
          </table>
      </div>
    );
  }
}

export default App;
